import React from "react";
import { Drawer, withStyles } from "@material-ui/core";
import List from "./List/List";

const styles = {
  drawer: {
    width: 250,
    height: "calc(100% - 64px)",
    marginTop: 64
  }
};

const DrawerComponent = ({
  classes,
  filterStatus,
  filterToggle,
  toggleRatings,
  toggleRatingsStatus,
  filterHandlers,
  filterSelections,
  manufactureSelections,
  discTypeSelections,
  resetButton
}) => {
  return (
    <Drawer
      anchor="right"
      variant="persistent"
      open={filterStatus}
      onClose={filterToggle}
    >
      <div tabIndex={0} role="button" className={classes.drawer}>
        <List
          toggleRatingsStatus={toggleRatingsStatus}
          toggleRatings={toggleRatings}
          handlers={filterHandlers}
          selections={filterSelections}
          manufactureSelections={manufactureSelections}
          discTypeSelections={discTypeSelections}
          resetButton={resetButton}
        />
      </div>
    </Drawer>
  );
};

export default withStyles(styles)(DrawerComponent);
